def adjust_history_to_reward_and_punishment(history):
	for event in history:
		event = history[event]
		event_type = event['type']

		if 'importance' in event:
			event_importance = event['importance']
		if event_type == 'SmartEffort':
			event['reward'] = event_importance
		elif event_type == 'Stupidity':
			event['punishment'] = event_importance
	return history

